import { S3Client, PutObjectCommand } from "@aws-sdk/client-s3";
// Set the parameters

const TPAT_VIDEOS_BUCKET = "tpatvideos";

async function uploadTos3(videoBlob) {
  const s3Client = gets3Client();
  try {
    const uploadParams = {
      Bucket: TPAT_VIDEOS_BUCKET,
      Body: videoBlob,
      Key: "Teacher1Task1Timestamp2.webm",
      Metadata: {
        "Content-Type": "video/webm",
        username: "Teacher 1",
        email: "teacher@gmail.com",
        task: "1",
      },
    };
    const data = await s3Client.send(new PutObjectCommand(uploadParams));
    console.log("Success", data);
    return data;
  } catch (err) {
    console.log("Error sfsd", err);
  }
}

function gets3Client() {
  const client = new S3Client({
    region: "us-east-2",
    credentials: {
      accessKeyId: "AKIAR4AR4PW6KXERGY7I",
      secretAccessKey: "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",
    },
  });

  return client;
}

export { gets3Client, uploadTos3 };
